import { ChangeEvent, useEffect, useState } from "react";
import { FurnitureModel } from "../../../Models/FurnitureModel";
import "./List.css";
import { dataService } from "../../../Services/DataService";
import { notify } from "../../../Utils/Notify";
import { FurnitureTypeModel } from "../../../Models/FurnitureTypeModel";

function List(): JSX.Element {

const [furniture, setFurniture]=useState<FurnitureModel[]>([]);
const [types, setTypes]=useState<FurnitureTypeModel[]>([]);


useEffect(()=> {
    dataService.getAllFurniture()
    .then(furniture=> setFurniture(furniture))
    .catch(err=>notify.error(err))
},[]);

async function displayFurniture(args:ChangeEvent<HTMLSelectElement>){
    const audienceId= +args.target.value;
    dataService.getGiftsByAudienceId(audienceId)
    .then(gifts=> setGifts(gifts))
    .catch(err=>notify.error(err));
}



    return (
        <div className="List">

			<h2>Furniture List</h2>

            <table className="table table-hover ">
        <thead>
            <tr>
                <th>Furniture Type</th>
                <th>Size</th>
                <th>Color</th>
                <th>Price</th>
            </tr>
        </thead>
        <tbody>
            {furniture.map(g=><tr key= {g.id}>

                <td>{g.type}</td>
                <td>{g.size}</td>
                <td>{g.color}</td>
                <td>{g.price}</td>
            </tr>)}
        </tbody>
      </table>


        </div>
    );
}

export default List;
